\section{($!$ Prolegomena) --- basic process footer}

It just terminates

Typechecking errors:
\begin{itemize} \item \theta S expression is not allowed for the time unit presentation because the type is not $arithmos$
\begin{verbatim} \t1 Test116 \circdef c.n1!n2?x \circat x? \then \lcirctime 20 \rcirctime d \circat f \then \lcirctime \theta S \rcirctime \Skip \also \t1 Test93 \circdef c.n1!n2?x \then \lcirctime 20 \rcirctime d \then \lcirctime \theta S \rcirctime \Skip \also \t1 Test60 \circdef A \circendby \lcirctime \theta S \rcirctime \also \t1 Test41 \circdef \lcirctime \theta S \rcirctime \circstartby \Skip \also \t1 Test21 \circdef \circwait w: \theta S \circspot \Skip \also \t1 Test3 \circdef \circwait \theta S \also \end{verbatim}
\item power arithmos is not allowed for time expression
\begin{verbatim} \t1 Test62 \circdef A \circendby \lcirctime 1 \upto 20 \rcirctime \also \t1 Test49 \circdef \lcirctime 1 \upto 20 \rcirctime \circstartby \Skip \also \end{verbatim}
\item type of f is \power ( \arithmos \cross ( \arithmos \cross \arithmos ) ), which is not arithmos.
\begin{verbatim} \t1 Test2 \circdef \circwait f \also \also \t1 Test40 \circdef \lcirctime f \rcirctime \circstartby \Skip \also \end{verbatim}
\item Different types of failed errorneous test cases
\begin{verbatim} \t1 Test4 \circdef \circwait [~ x: \nat | x > 10 ~] \also \t1 Test20 \circdef \circwait z : f \circspot \Skip \also \t1 Test22 \circdef \circwait x?: S \circspot \Skip \also \t1 Test23 \circdef \circwait f: S \circspot \Skip \end{verbatim} \end{itemize}
